// src/components/Skills.js
import React from 'react';
import './Skills.css';

const Skills = () => {
    return (
        <div className="container-content">
            <h2>Skills</h2>
            <ul>
                <li>JavaScript</li>
                <li>React</li>
                <li>Node.js</li>
                {/* Add more skills as needed */}
            </ul>
        </div>
    );
};

export default Skills;
